`;
export const sPaper = styled(Paper)`
    padding: 8px !important;
    word-break: break-all;
    flex-basis: 200px;
    width: 200px;
`;
export const WrapperTitle = styled.h2`
    font-size 18px;
    margin: 8px 0;
`;
export const WrapperFullName = styled.h4`
    font-size: 16px;
    font-weight: bold;
    margin: 8px 0;
    color: #2d3748;
`;
export const WrapperLink = styled.a`
    font-size: 16px;
    font-weight: bold;
